import CoursesOffered from "./CoursesOffered";
import "./Assest/Style.css";
import AboutUs from "./AboutUs";
import React from "react";
import SideBar from "./SideBar";
import Google from "./Rating";
import LandingPage from "./LandingPage";
// import Reviews from "./Reviews";
// import ReviewForm from "./Form";
// import Map from "./Map";

class HomePage extends React.Component {
  render() {
    return (
      <>
        <section id="home" className="banner">
          <LandingPage />
        </section>
        <section className="courses mt-2">
          <CoursesOffered />
        </section>
        <section id="about_Us" className="aboutUs">
          <AboutUs />
        </section>
        <section className="sidebar mt-2">
          <SideBar />
        </section>
        <section id="google_Rating" className="googleRating"></section>
        <section></section>
        <section id="google_Map" className="googleMap mb-3">
          <div className="container gMap">
            <iframe
              src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3890.083706533847!2d80.0520945147389!3d12.837867290943699!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3b007971087883f5%3A0x518ecbdae2d8bcee!2sCareer%20Guidance%20Technologies%2C%20Guduvancheri!5e0!3m2!1sen!2sin!4v1678181804916!5m2!1sen!2sin"
              width="100%"
              height="450"
              style={{ border: 0 }}
              allowFullScreen=""
              loading="lazy"
              referrerPolicy="no-referrer-when-downgrade"
              className="map"
            ></iframe>
          </div>
        </section>
      </>
    );
  }
}

export default HomePage;
